import coca from "./coca.jpg";
import fanta from "./fanta.jpg";
import sprite from "./sprite.jpg";
import sting from "./sting.jpg";
import white from "./white.jpg";

class Image {
  constructor(type, image) {
    this.type = type;
    this.image = image;
  }
}
const images = {
  coca: new Image("coca", coca),
  fanta: new Image("fanta", fanta),
  sprite: new Image("sprite", sprite),
  sting: new Image("sting", sting),
  white: new Image("white", white),
};
export default images;
